import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

ReactDOM.render(
  <React.StrictMode>
    <App style={{ backgroundColor: "lightcoral" }} />
  </React.StrictMode>,
  document.getElementById("root")
);
